import React from 'react';
import ReactDOM from 'react-dom';
import faker from 'faker';
import CommentDetail from './CommentDetail';

const App = () => {
    return (
        <div className='ui container comments'>
            <CommentDetail author='Sam' timeAgo='Today at 4:45PM' imgSrc={faker.image.image()} commentText='Love your work!'/>
            <CommentDetail author='Alex' timeAgo='Today at 2:00PM' imgSrc={faker.image.image()} commentText='Try again fool!'/>
            <CommentDetail author='Jane' timeAgo='Yesterday at 1:00AM' imgSrc={faker.image.image()} commentText='Fingers crossed!'/>
        </div>
    );
};

ReactDOM.render(<App />, document.querySelector('#root'));
